import './category.style.scss'
import Home from './route/home/home.component';
import { Routes, Route , Outlet} from 'react-router-dom';

const Navigation = () => {
  return (
    <div>
      <div>
        <h1>I am the navigation bar</h1>
        </div>
    </div>
  )
}
const App = () => {
  return (
    <Routes>
       <Route path='/' element={<Home />} />

    </Routes>

  )
}

export default App;
